protected internal void queryFiltersChanged()
{
    #define.companyId(1)
    #define.isSelected(2)

    super();

    Query savedQuery = projTable_ds.queryRun().query();
    QueryBuildDataSource qbdsProject = savedQuery.dataSourceTable(tableNum(ProjTable));
    QueryBuildRange qbrStatus = qbdsProject.findRange(fieldNum(ProjTable, Status));
    if (qbrStatus)
    {
        if (qbrStatus.enabled() && qbrStatus.value() == SysQuery::valueNot(ProjStatus::Completed))
        {
            CtrlActiveAll.selection(enum2int(ProjActiveAll::Active));
        }
        else
        {
            CtrlActiveAll.selection(enum2int(ProjActiveAll::All));
        }
    }
    QueryBuildRange qbrParentId = qbdsProject.findRange(fieldNum(ProjTable, ParentId));
    if (qbrParentId)
    {
        if (qbrParentId.enabled() && qbrParentId.value() == SysQuery::valueEmptyString())
        {
            CtrlProjLevels.selection(enum2int(ProjLevels::Top));
        }
        else
        {
            CtrlProjLevels.selection(enum2int(ProjLevels::All));
        }
    }
    boolean allSelected = true;
    str selectedValues;
    container companyRanges = savedQuery.getCompanyRange();
    int numRanges = conLen(companyRanges);
    if (numRanges > 0)
    { 
        str succeedingFormat = '%2' + ProjConstants::multipleSelectLEDelimiter + '%1';
        container companyRange;
        for (int i = 1; i <= numRanges; i++)
        {
            companyRange = conPeek(companyRanges, i);
            if (conPeek(companyRange, #isSelected))
            {
                if (!selectedValues)
                {
                    selectedValues = conPeek(companyRange, #companyId);
                }
                else
                {
                    selectedValues = strFmt(succeedingFormat, selectedValues, conPeek(companyRange, #companyId));
                }
            }
            else
            {
                allSelected = false;
            }
        }
    }
    if (allSelected)
    {
        CtrlCompanyLookup.text("@SYS4006013");
    }
    else if (selectedValues)
    {
        CtrlCompanyLookup.text(selectedValues);
    }
    else
    {
        CtrlCompanyLookup.text(curExt());
    }
}

public void createProject()
{
    Args args = new Args(formStr(ProjTableCreate));
    FormRun formRun;

    if (element.args().menuItemName() == menuItemDisplayStr(ProjMgmtProjectTemplates))
    {
        args.parmEnum(ProjTableCreateLevel::Template);
        args.parmEnumType(enumNum(ProjTableCreateLevel));
    }

    args.caller(element);
    args.openMode(OpenMode::New);
    args.copyCallerQuery(CopyCallerQuery::No);
    formRun = classfactory.formRunClass(args);
    formRun.init();
    formRun.run();
    formRun.wait();
}

public void executeQuery()
{
    // Apply filters before super
    Object argsObject = element.args().parmObject();
    ProjProjectsListPageFilterApplier filterApplier = argsObject as ProjProjectsListPageFilterApplier;
    if (filterApplier)
    {
        if (filterApplier.parmClearFormsBuiltInStageFilter())
        {
            // Switch the filter control to show all 
            // and hide it because the filter applier may be filtering on a specific stage which would mismatch with the displayed control value
            CtrlActiveAll.selection(ProjActiveAll::All);
            CtrlActiveAll.visible(false);
        }

        filterApplier.apply(this.query());
    }

    super();
}

