public void lookup()
{
    Args args = new Args(formStr(ProjResourceCompanyLookup));
    FormRun formRun;

    args.callerFormControl(CtrlCompanyLookup);
    formRun = classfactory.formRunClass(args);
    formRun.init();
    this.performFormLookup(formRun);
    formRun.wait();
    ProjLegalEntityLookupListPageHelper::setFilterValuesFromControl(projTable_ds, ctrlCompanyLookup.valueStr());

    element.formCustomFilterChanged();
}

